        font-style: normal;
        font-weight: 400;
        font-display: swap;
        src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isQFJXUdVNFKPY.woff2)
          format("woff2");
        unicode-range: U+0102-0103, U+0110-0111, U+0128-0129, U+0168-0169, U+01A0-01A1,
          U+01AF-01B0, U+1EA0-1EF9, U+20AB;
      }
      /* latin-ext */
      @font-face {
        font-family: "VT323";
        font-style: normal;
        font-weight: 400;
        font-display: swap;
        src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isRFJXUdVNFKPY.woff2)
          format("woff2");
        unicode-range: U+0100-024F, U+0259, U+1E00-1EFF, U+2020, U+20A0-20AB,
          U+20AD-20CF, U+2113, U+2C60-2C7F, U+A720-A7FF;
      }
      /* latin */
      @font-face {
        font-family: "VT323";
        font-style: normal;
        font-weight: 400;
        font-display: swap;
        src: url(https://fonts.gstatic.com/s/vt323/v17/pxiKyp0ihIEF2isfFJXUdVNF.woff2)
          format("woff2");
        unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA,
          U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215,
          U+FEFF, U+FFFD;
      }
      .d {
        fill: #f48eb0;
      }
      .f,
      .g,
      .h {
        fill: #fce2db;
      }
      .j {
        fill: #b370a2;
      }
      .k,
      .l {
        fill: #7b4595;
      }
      .g {
        font-family: VT323, Arial, sans-serif;
        font-size: 65px;
        letter-spacing: 0.08em;
      }
      .h,
      .j,
      .l {
        stroke: #270f28;
        stroke-miterlimit: 10;
      }
      `;
        styles.innerHTML += cssRules.join("\n");
        defs.appendChild(styles);
        this.DOM.ticket.appendChild(defs);
        this.$store.commit("prepFont");
      });
    },
    setup() {
      this.DOM = {
        container: this.$refs.container,
        ticket: this.$refs.ticket,
        canvas: this.$refs.canvas,
        button: this.$refs.saveBtn,
        download: this.$refs.download,
      };

      this.prepareSVG();

      gsap.set([this.DOM.ticket, this.DOM.button], {
        opacity: 0,
        scale: 0,
        transformOrigin: "50% 50%",
      });

      gsap
        .timeline()
        .addLabel("start", 0)
        .to(
          this.DOM.ticket,
          {
            scale: 1,
            opacity: 1,
            duration: 3.2,
            ease: "expo.inOut",
            onStart: () =>
              setTimeout(
                () =>
                  this.$store.commit("playSound", {
                    soundName: "tmShowTicket",
                  }),
                1200
              ),
          },
          "start"
        )
        .to(
          this.DOM.button,
          {
            scale: 1,
            opacity: 1,
            duration: 1.6,
            ease: "expo.inOut",
            onStart: () =>
              setTimeout(
                () =>
                  this.$store.commit("playSound", {
                    soundName: "tmDownloadPop",
                  }),
                640
              ),
          },
          ">"
        )
        .play();
    },
    save() {
      this.$store.commit("playSound", { soundName: "click" });

      const xml = new XMLSerializer().serializeToString(this.DOM.ticket);
      const svg64 = btoa(xml);
      const b64Start = "data:image/svg+xml;base64,";
      const { width, height } = this.DOM.ticket.getBoundingClientRect();

      const canvas = this.DOM.canvas;
      const ctx = canvas.getContext("2d");
      canvas.width = width;
      canvas.height = height;
      ctx.fillStyle = "#270F28";
      ctx.fillRect(0, 0, width, height); // fill the color on the canvas

      const image = new Image();
      image.onload = () => {
        ctx.font = "65px VT323";
        ctx.drawImage(image, 0, 0, width, height);

        this.triggerDownload(canvas, `the-tot-ticket-[${this.ticketID}].png`); // download the image when the image has been loaded onto the canvas
      };
      image.src = b64Start + svg64;

      setTimeout(() => {
        this.$store.commit("showPrompt", { path: "scenes-turnstiles" });
      }, 3600);
    },
    triggerDownload(canvas, imageName) {
      canvas.toBlob((blob) => {
        const anchor = document.createElement("a");
        anchor.download = imageName;
        anchor.href = URL.createObjectURL(blob);

        anchor.click();

        URL.revokeObjectURL(anchor.href); // remove it from memory and save on memory!
      }, "image/png");
    },
  },
};
</script>

